import { ReactElement } from "react";
import CardList from "./CardList";
import Text from "./Text";
import * as S from "./Container.style";

const MainTemplate = (): ReactElement => {
  return (
    <S.MainWrap>
      <Text></Text>
      <CardList />
    </S.MainWrap>
  );
};

export default MainTemplate;
